import React from 'react';

const Dashboard = () => {
  return (
    <div id="dashboard">
      <DashboardMenu />
    </div>
  );
};

const DashboardMenu = () => {
  return (
    <div id="dashboard-menu">
      <button type="button">Start Workout</button>
      <button type="button">Log Measurement</button>
    <button type="button">View Data</button>
  </div>
  );
}

export default Dashboard;
